import React from 'react';
import './Landing.css';
import ebaTitle from './img/EBA_title_img.jpeg';

function Landing() {
    const IMAGES = {
        personalArchives: require('./img/personalArchives.png').default,
        travelogues: require('./img/Travelogues.png').default,
        tourOperators: require('./img/TourOperators.png').default,
        digitalExhibit: require('./img/DigitalExhibit.png').default,
        about: require('./img/About.png').default
    }

    return (
        <div className='body'>
            <Banner/>
            <NavCards images={IMAGES}/>
        </div>
    )
}

function Banner() {
    return (
        <div className='title-banner'>
            <div className='container'>
                <div className='title-box'>
                    <img src={ebaTitle} alt='Emma B. Andrews title'/>
                </div>
            </div>
            <div className='container'>
                <div className='image-box'>
                    <div className='header-box'>
                        <h1>Travelers In Egypt</h1>
                    </div>
                </div>
            </div>
        </div>
    )
}

function NavCards(props) {
    return (
        <div className='card row'>
            <div className='card-container'>
                <RenderCards images={props.images}/>
            </div>
        </div>
    )
}

function RenderCards(props) {
    let cards = Object.keys(props.images).map((eachImage) => {
        let card = 
            <div className='each-card'>
                <div className='top-card'>
                    <img src={eachImage[1]} alt={eachImage} />
                </div> 
                <div className='bottom-card'>
                    <h2>Text</h2>
                </div>
            </div>;
        return card;
    });

    return (
        <div className='card-container'>
            {cards}
        </div>
    );
}

export default Landing;
